@wesloganfishing @drewcookfishing @tyler_rivet_fishing @brockmosleyfishing @brandonpalaniuk @caleb.sumrall.fishing

@bryanschmittfishing is a decorated veteran in the world of professional bass fishing but had not reached the winner's circle in two seasons on the Bassmaster Elite Series until Lake Champlain.

Schmitt's Champlain dominance is known in the sport and he used it to WIN BIG in 2021 with his Elite victory. He is the @marathonpetroleum Peak Performance for the 8th stop of the 2021 Bassmaster Elite Series season. 
#Bassmaster #LakeChamplain #PeakPerformance

@hayden.scott.fishing and @fernandes_fishing of Adrian College have won the @Carhartt Bassmaster College Series National Championship presented by @BassProShops with a three-day total of 63 pounds, 10 ounces!
